import React from 'react'

function Todo() {
    const centerStyle = {
        width: '50%',
        margin: '0 auto'
      }
      const bgColor = {
          backgroundColor: '#219dcf'
      }
    return (
        <div>
            <ul style={centerStyle} className="list-group">
                <li style={bgColor} className="list-group-item">TODO</li>
                <li className="list-group-item"> <input type="checkbox"/> Todo 1</li>
                <li className="list-group-item">Todo 2</li>
                <li className="list-group-item">Todo 3</li>
                <li className="list-group-item">Todo 4</li>
                <li className="list-group-item">Todo 5</li>
           </ul>
        </div>
    )
}

export default Todo
